// eslint-disable-next-line no-unused-vars
import React from 'react';

function formatPhoneNumber(stringPhone) {
  console.log(stringPhone, typeof stringPhone);
  stringPhone.slice(1);
  const numberPhone = Number(stringPhone);
  console.log(numberPhone, typeof numberPhone);
}

export default formatPhoneNumber;
